import React, { Component } from 'react';
import styled from 'styled-components';

const Grid = styled.div`
display:grid;
grid-template-columns: 1fr 1fr;
`

export default class Search extends Component {
  render() {
    return (
      <div className="searchContainer">
        <Grid>
          <h2>Buscar</h2>
        </Grid>
      </div>
    )
  }
}
